import React from "react";

const Navbar = () => {
  return(
    <>
    <div className="main">
      <div className="nav">
        <h6>Get the App</h6>
        <ul>
          <li>LogIn</li>
          <li>SignUp</li>
        </ul>
      </div>
      <div className="zomato"> Zomato</div>
      <div className="zomato-bottom"></div>
      <div className="location"></div>
      <div className="search"></div>
    </div>
    </>
  );
};
export default Navbar;
